import xml.etree.ElementTree as ET

def parse_word_data(xml_string):
    """"""
    word_data = ET.fromstring(xml_string)
    return {'adjective': word_data.find('adjective').text, 'verb': word_data.find('verb').text, 'adverb': word_data.find('adverb').text, 'noun': word_data.find('noun').text}
